/* For page Planned task*/
/*contains
earlier ,today ,later
*/
import React, { memo } from "react";
import "../CSS/alltasks.css";
import "../App.css";
import Task from "../components/task.tsx";

interface taskprop {
  name: String;
  dueDate: Date;
  important: boolean;
  repeat: boolean;
  completed: boolean;
  _id: String;
}

interface planedProp {
  today: taskprop[];
  tommorow: taskprop[];
  previous: taskprop[];
}

function Planned({ today, tommorow, previous }: planedProp) {
  const plannedIcon = require("../Images/sidebar-box.png");

  return (
    <div className="alltask">
      <div className="alltask-heading">
        <img src={plannedIcon} alt="planned"></img>
        <div>Planned</div>
      </div>
      <br />
      <br />
      <div className="alltask-parts">
        <div className="alltask-parts-head">Today {today.length}</div>
        <div>
          {today.map((obj, index) => (
            <>
              <Task {...obj} />
              <br />
            </>
          ))}
        </div>
      </div>
      <br />
      <br />
      <div className="alltask-parts">
        <div className="alltask-parts-head">Tommorow {tommorow.length}</div>
        <div>
          {tommorow.map((obj, index) => (
            <>
              <Task {...obj} />
              <br />
            </>
          ))}
        </div>
      </div>
      <br />
      <br />
      <div className="alltask-parts">
        <div className="alltask-parts-head">Previous 1</div>
        <div>
          {previous.map((obj, index) => (
            <>
              <Task {...obj} />
              <br />
            </>
          ))}
        </div>
      </div>
    </div>
  );
}

export default memo(Planned);
